DNA = ""

DNAbases = list(DNA)
DNAbases.reverse()
print(DNAbases)

cDNA = " "

for nucleotide in DNAbases:
    if nucleotide == "A":
        cDNA += "T"
    elif nucleotide == "T":
        cDNA += "A"
    elif nucleotide == "G":
        cDNA += "C"
    elif nucleotide == "C":
        cDNA += "G"
    
print(cDNA)

